import React from "react";
import ReactDOM from "react-dom";
import ModalImage from "react-modal-image";
import "./styles.css";

function App() {
  return (
    <div className="App">


      <div className="AppImage">
        <ModalImage small="./images/test.png" large="./images/test.png" />
